data.text:
@youngallaji1 Arewa youths on twitter are experts of double standards.
This is time to raise voice and rage against the people sponsoring those who take away your family and drive you away from your villages.
They fund people who Kill your brothers who fight to protect you

@VelempiniN @MTshwete Here is my last thought:

Biko spoke of feelings of powerlessness "where we smile in public and scream in the privacy of the toilet"

This rage is felt by every one who is struggling to feed and protect their children and families
